import React from 'react';
import { FaArrowCircleRight } from 'react-icons/fa';
class AddItem extends React.Component{
 render(){
 return(<div className="d-flex justify-content-center align-items-center" style={{width:"100%"}}>
     <form style={{width:"60%"}}>
  <div className="custom-control custom-radio shadow p-4" style={{width:"100%",height:"40px",backgroundColor:"rgb(71,64,89,0.9)",borderRadius:"5px"}}>
    <input type="radio" className="custom-control-input" id="customRadio" name="example" value="customEx" />
    <label className="custom-control-label" for="customRadio">Custom radio 1</label>
  </div>
  <div className="custom-control custom-radio">
    <input type="radio" className="custom-control-input" id="customRadio2" name="example" value="customEx" />
    <label className="custom-control-label" for="customRadio2">Custom radio 2</label>
  </div>
</form>
 </div>);
 }
}
export default AddItem ;
